Адреса могут быть введены в следующих форматах:
  • в историческом формате – по административно-территориальному делению;
  • по муниципальному делению с учетом требований Федерального закона от 06.10.1999 № 131-ФЗ «Об общих принципах организации местного самоуправления в Российской Федерации».

Adresy można wpisać w następujących formatach:
 • w formacie historycznym – wg podziału administracyjnego i terytorialnego;
 • w formacie gminnym, biorąc pod uwagę wymagania Prawa federalnego z dnia 06.10.1999 r. Nr 131-PF "O ogólnych zasadach organizacji samorządu terytorialnego w Federacji Rosyjskiej".

Adresler aşağıdaki biçimlerde girilebilir: 
* tarihsel biçimde – idari ve bölgesel olarak bölünmesine göre; 
* belediye bölünmesi göre 06.10.1999 tarihli 131-FZ "Rusya Federasyonu yerel yönetim organizasyonun genel ilkeleri hakkında" Federal Kanunun gereksinimleri dikkate alınarak .
